/*
=========================================================
* Material Kit 2 React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-kit-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import Tooltip from "@mui/material/Tooltip";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKButton from "components/MKButton";
import MKTypography from "components/MKTypography";
import secretaria_salud from "assets/images/secretaria_salud.png";
import secretaria_salud_dgo from "assets/images/salud_durango.png";
import imss from "assets/images/imss.jpg";
import issste from "assets/images/issste.jpg";
import seguro_popular from "assets/images/seguro_popular.jpeg";
import cruz_roja from "assets/images/cruz_roja.png";


// Images
import bgImage from "assets/images/bg-presentation.jpg";

function Download() {

  const ImageZoom = ({ src }) => {
    const [isZoomed, setIsZoomed] = useState(false);

    const handleMouseEnter = () => {
      setIsZoomed(true);
    };

    const handleMouseLeave = () => {
      setIsZoomed(false);
    };

    const zoomStyle = {
      transform: isZoomed ? 'scale(1.2)' : 'scale(1)', // Aumenta el tamaño al pasar el cursor
      transition: 'transform 0.3s ease', // Agrega una transición suave
    };
  }

  return (
    <MKBox component="section" py={{ xs: 0, sm: 12 }}>
      <MKBox
        variant="gradient"
        bgColor="info"
        position="relative"
        borderRadius="xl"
        sx={{ overflow: "hidden" }}
      >
        <MKBox
          component="img"
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
          style={zoomStyle}
          src={bgImage}
          alt="pattern-lines"
          position="absolute"
          top={0}
          left={0}
          width="100%"
          zIndex={1}
          opacity={0.5}
        />
        <Container sx={{ position: "relative", zIndex: 2, py: 12 }}>
          <Grid container item xs={12} md={7} justifyContent="center" mx="auto" textAlign="center">
            <MKTypography variant="h2" color="light" mb={5}>
              ¿Quieres conocer más sobre nuestros paquetes empresariales?
            </MKTypography>
            <MKTypography variant="h3" color="light" mb={1}>
              ¡CONTACTANOS!{" "}
            </MKTypography>
          </Grid>
          <Grid container item xs={12} md={7} justifyContent="center" mx="auto" textAlign="center">
          <MKButton
              variant="gradient"
              color="info"
              size="large"
              component="a"
              mt={5}
              href="/pages/landing-pages/contact-us"
              sx={{ mb: 2 }}
            >
              CONTACTO
            </MKButton>
          </Grid>
        </Container>
      </MKBox>
      <Container>
        <Grid container item xs={6} mx="auto">
          <MKBox textAlign="center">
            <MKTypography variant="h3" mt={6} mb={3}>
              LINKS DE INTERÉS
            </MKTypography>
            <Grid container spacing={3} justifyContent="center">
              <Grid item xs={4} lg={2}>
                <Tooltip title="Secretaría de Salud Gobierno de México">
                  <MKBox
                    component="a"
                    href="https://www.gob.mx/salud"
                    target="_blank"
                  >
                    <MKBox
                      component="img"
                      src={secretaria_salud}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
              <Grid item xs={4} lg={2}>
                <Tooltip title="Secretaría de Salud del Estado de Durango">
                  <MKBox
                    opacity={0.5}
                    component="a"
                    href="#"
                    target="_blank"
                    onClick={(e) => e.preventDefault()}
                  >
                    <MKBox
                      component="img"
                      src={secretaria_salud_dgo}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
              <Grid item xs={4} lg={2}>
                <Tooltip title="Instituto Mexicano del Seguro Social">
                  <MKBox
                    opacity={0.5}
                    component="a"
                    href="#"
                    target="_blank"
                    onClick={(e) => e.preventDefault()}
                  >
                    <MKBox
                      component="img"
                      src={imss}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
              <Grid item xs={4} lg={2}>
                <Tooltip title="Instituto de Seguridad y Servicios Sociales de los Trabajadores del Estado">
                  <MKBox
                    opacity={0.5}
                    component="a"
                    href="#"
                    target="_blank"
                    onClick={(e) => e.preventDefault()}
                  >
                    <MKBox
                      component="img"
                      src={issste}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
              <Grid item xs={4} lg={2}>
                <Tooltip title="Seguro Popular Mexicano">
                  <MKBox
                    component="a"
                    href="https://www.creative-tim.com/product/material-kit-react"
                    target="_blank"
                  >
                    <MKBox
                      component="img"
                      src={seguro_popular}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
              <Grid item xs={4} lg={2}>
                <Tooltip title="Cruz Roja Mexicana">
                  <MKBox
                    opacity={0.5}
                    component="a"
                    href="#"
                    target="_blank"
                    onClick={(e) => e.preventDefault()}
                  >
                    <MKBox
                      component="img"
                      src={cruz_roja}
                      width="100%"
                    />
                  </MKBox>
                </Tooltip>
              </Grid>
            </Grid>
          </MKBox>
        </Grid>
      </Container>
    </MKBox>
  );
}

export default Download;
